import "./job.css"
import React, { useState } from 'react'

const Job = () => {
    const [jobs] = useState([
        {
            title: 'IT Help Desk Agent - REMOTE',
            company: 'Learning Care Group, Inc',
            location: 'Henderson, NV 89014',
            salary: '$25-$30 per hour',
            text: 'Join a strong community where all we do is care-for the children and families we serve every day, as well as for our dedicated team members.',
            details: 'https://www.amazon.com/',
            apply: 'https://www.amazon.com/'
        },
        {
            title: 'The Autism Show',
            text: 'The Autism Show on April 2nd is an event focused on autism, offering information, resources, and support for individuals, families, and professionals.'
        },
        {
            title: 'Inclusion Symposium',
            text: 'On March 3rd, International School Dhaka (ISD) in Bangladesh will host the inaugural Inclusion Symposium, focusing on diversity and inclusion in child special needs education.'
        },
        {
            title: 'Rise & Shine',
            text: 'Rise & Shine on April 2nd is a special event dedicated to children with autism, providing a platform for them to shine and thrive, and showcase their abilities to the world.'
        },
        {
            title: 'Inclusion Symposium',
            text: 'On March 3rd, International School Dhaka (ISD) in Bangladesh will host the inaugural Inclusion Symposium, focusing on diversity and inclusion in child special needs education.'
        },
        {
            title: 'Rise & Shine',
            text: 'Rise & Shine on April 2nd is a special event dedicated to children with autism, providing a platform for them to shine and thrive, and showcase their abilities to the world.'
        }
    ])



  return (
    <div className="job">
      <section className="jsec">
        <div className="jobcontainer">
            <h1 className="jobname">Job Openings For Your Child</h1>
            <div className="jobs">
                {
                    jobs.map((jobcard, i) => (

                        <div key={i} className="jobcardcard">
                            <h3 className="jobcardname">{jobcard.title}</h3>
                            <h3 className="jobcardname">{jobcard.title}</h3>
                            
                            <span className="jobptext">{jobcard.text}</span>
                            
                        </div>

                    ))
                }
                
            </div>

        </div>
      </section>
    </div>
  )
}

export default Job
